// Export individual categories for easier access
export const emojiCategories = {
  'Smileys & Emotion': twitterEmojiDataset.filter(e => e.category === 'Smileys & Emotion'),
  'People & Body': twitterEmojiDataset.filter(e => e.category === 'People & Body'),
  'Animals & Nature': twitterEmojiDataset.filter(e => e.category === 'Animals & Nature'),
  'Food & Drink': twitterEmojiDataset.filter(e => e.category === 'Food & Drink'),
  'Travel & Places': twitterEmojiDataset.filter(e => e.category === 'Travel & Places'),
  'Activities': twitterEmojiDataset.filter(e => e.category === 'Activities'),
  'Objects': twitterEmojiDataset.filter(e => e.category === 'Objects'),
  'Symbols': twitterEmojiDataset.filter(e => e.category === 'Symbols'),
  'Flags': twitterEmojiDataset.filter(e => e.category === 'Flags'),
};

// Helper function to find emoji by hex code
export const findEmojiByHex = (hex: string): EmojiItem | undefined => {
  return twitterEmojiDataset.find(e => e.hex === hex);
};

// Helper function to find emoji by name
export const findEmojiByName = (name: string): EmojiItem | undefined => {
  return twitterEmojiDataset.find(e => e.name.toLowerCase().includes(name.toLowerCase()));
};

// Helper function to validate if hex code is supported
export const isSupportedEmoji = (hex: string): boolean => {
  return twitterEmojiDataset.some(e => e.hex === hex);
};

export default twitterEmojiDataset;
